import React from 'react';
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Container from "react-bootstrap/Container";
import './Footer.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faAngleRight } from '@fortawesome/free-solid-svg-icons'
import ListGroup from "react-bootstrap/ListGroup";

const Footer = () => {
  return (
    <>
      <footer className="footer backGround">
        <Container>
          <Row>
            <Col xs={6} md={3}>
              <p className="footer_header"><span>О нас</span></p>
              <h3>VANDOORS</h3>
              <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. </p>
            </Col>
            <Col xs={6} md={3}>
              <p className="footer_header"><span>Ссылки</span></p>

              <ListGroup variant="flush">
                <ListGroup.Item><FontAwesomeIcon icon={faAngleRight} /> О Компании</ListGroup.Item>
                <ListGroup.Item><FontAwesomeIcon icon={faAngleRight} /> Бренди</ListGroup.Item>
                <ListGroup.Item><FontAwesomeIcon icon={faAngleRight} /> Наши преимущества</ListGroup.Item>
                <ListGroup.Item><FontAwesomeIcon icon={faAngleRight} /> Каталог</ListGroup.Item>
              </ListGroup>
            </Col>
            <Col xs={6} md={3}>
              <p className="footer_header"><span>Обратная связь </span></p>
            </Col>
            <Col xs={6} md={3}>

            </Col>
          </Row>
        </Container>
      </footer>
    </>
  );
};

export default Footer;
